import React, { Component } from 'react';

class Schedule extends Component {
  render() {
    return (
        <div className="container-fluid">
            <h1>
                Schedule Page Content
            </h1>
            <iframe src="https://calendar.google.com/calendar/embed?src=handinhandsafetytraining%40gmail.com&ctz=America%2FLos_Angeles" style={{border: 0}} width="800" height="600" frameborder="0" scrolling="no"></iframe>
        </div>
    );
  }
}

export default Schedule;
